script: |
  super -f text -I q1222.spq | sort > q1222.out

inputs:
  - name: q1222.spq
    data: |
      SELECT DISTINCT 83 AS col1 FROM tab0 (FORMAT parquet) WHERE - col2 * + + ( - col0 ) * + col1 NOT BETWEEN NULL AND + + 92 / + - ( - 21 ) * col0 + col2;
  - name: tab0

outputs:
  - name: q1222.out
    data: |
      83
